## Vue.js 3.0

### Composition API

* Setup関数を使用

```javascript

export default{
  setup(){
    return{
      // templateで使用する情報
      // 変数 or function
    }
  }
}
```

#### reactiveとcomputed

```javascript
//scriptタグ内に記載
import {reactive, computed} from "vue"

export default{
  setup(){
    // Vue2のdata的な
    const hoge = reactive({huga:1})
    // 
    const computedhoge = computed(() => hoge*2)

    return{
      hoge, // 1
      computedhoge // 2
    }
  }
}
```

### emit定義

Vue3.0からはemitを定義として記載し，このコンポーネントからのイベントを一括で確認できるようになっている

```javascript
emit: {
  click(val){
    // 型や文字数等のチェックが可能
    return typeof val === "string"
  }
}
```


### Teleport

* teleportタグにtergetを指定しておく事で，このコンポーネントが描画されたときに指定したtargetに要素を描画する事ができる．
* モーダルとしての利用や，特定のメニューボタン等
```html
<teleport target="selector"><!-- id or class or tagname -->
  <hogeToSelector />
</teleport>
```
